INSERT INTO `TB_COMENTARIO_JOGO_15` (`ID_COMENTARIO`, `ID_TABELA_JOGO`, `ID_USUARIO`, `DT_COMENTARIO`, `HR_COMENTARIO`, `DS_COMENTARIO`, `PSN_ID`) VALUES (8803, 1241, 952, '2017-05-25 00:00:00', '10:38', 'Bom Dia!\r\nPrimeiramente, eu respeito a decis√£o da modera√ß√£o mas n√£o entendo. Meu advers√°rio me deu 2 dias pra jogar, eu so conseguia jogar em um dos dias q ele colocou devido ao meu trabalho. E ele n√£o pode jogar no dia q eu falei q podia jogar(e ele tb falou) devido ao mesmo motivo.\r\nA minha resposta foi dentro do prazo e eu respondi q poderia jogar dentro do hor√°rio q meu adversario citou, porem ele teve um imprevisto de trabalho.\r\n\r\nEnt√£o n√£o entendo o pq o WO foi pra ele. Na ter√ßa q ele podia, eu n√£o podia por causa do meu trabalho. E na 4a que eu podia o dia inteiro (Tanto q fiz minha final da copa da UEFA nesse dia), ele n√£o pode por causa do trabalho dele. \r\nEnt√£o qual seria a diferen√ßa?? Mesmo q no ultimo dia, todas as informa√ß√µes foram passadas a tempo, dentro do prazo.\r\n\r\nTenham um bom dia!\r\nPedro Souza', 'pdesouza7');
