INSERT INTO `TB_COMENTARIO_JOGO_15` (`ID_COMENTARIO`, `ID_TABELA_JOGO`, `ID_USUARIO`, `DT_COMENTARIO`, `HR_COMENTARIO`, `DS_COMENTARIO`, `PSN_ID`) VALUES (8805, 1241, 985, '2017-05-25 00:00:00', '15:29', '#5   airesdias -  -  25/05/2017 05:22 \r\nPedro, infelizmente n√£o podemos adiar por causa do calend√°rio, ent√£o estarei decretando WO para o Real pois voc√™ entrou apenas no √∫ltimo dia para marcar dificultando a realiza√ß√£o da partida. \r\n\r\npedro por isso foi decretado o wo \r\nvc so apareceu no site no topico no ultimo dia e isso e considerado omissao parcial entendeu', 'saydsangelll');
INSERT INTO `TB_COMENTARIO_JOGO_15` (`ID_COMENTARIO`, `ID_TABELA_JOGO`, `ID_USUARIO`, `DT_COMENTARIO`, `HR_COMENTARIO`, `DS_COMENTARIO`, `PSN_ID`) VALUES (8806, 1241, 952, '2017-05-25 00:00:00', '16:29', 'Mano, n√£o t√¥ querendo criar nenhuma confus√£o, se ta parecendo, me desculpem. \r\nMas de novo eu n√£o concordo. \r\nExiste um prazo, e mesmo q fosse no √∫ltimo dia, eu estava dentro desse prazo. E o q eu t√¥ querendo explicar √© o seguinte. N√£o respondi antes pq estava em miss√£o, trabalho. Por√©m, mesmo q eu respondesse, eu n√£o estaria apto para jogar antes de 4a devido ao meu trabalho, n√£o respondi pq n√£o quis, eu tava no meio do nada, n√£o tinha como comunicar, foi algo devido a trabalho (mesmo motivo que o sayds n√£o pode jogar na 4a). Assim q cheguei em casa, pela manh√£, eu respondi o t√≥pico dizendo q eu podia jogar na 4a, nos hor√°rios propostos pelo pr√≥prio sayds. Contudo, o sayds colocou q n√£o estaria apto mais a jogar naquele hor√°rio proposto por ele mesmo, devido ao mesmo motivo que eu n√£o pude jogar antes. \r\nOu seja, os motivos eram os mesmos. E sendo no √∫ltimo dia ou n√£o, existe um prazo e o prazo foi seguido. Por√©m, o jogo n√£o pode ser realizado devido aos dois oponentes sofrerem do MESMO problema. \r\n\r\nDe novo, n√£o estou criando confus√£o, nunca tive problema nenhum aqui. Por√©m, descordo dessa decis√£o e como usu√°rio do site, me sinto no direito de falar. Contudo, como sempre,  respeito a decis√£o da ADM, mesmo discordando da mesma.\r\n\r\nPedro Souza', 'pdesouza7');
